Высокоэффективное укрепление тонких, слабых и ломких ногтей;
Запечатывает и утолщает ногтевую пластину, увеличивает ее эластичность;
Содержит смолу мастикового дерева и масло ягод асаи, которое наполовину состоит из ценных омега-3 и омега-6 жирных кислот и антиоксидантов.

Многофункциональное средство для быстрого восстановления ногтей;
Глубоко питает, увлажняет и восстанавливает ногтевую пластину;
Заполняет микроповреждения, стимулирует рост здоровых ногтей;
Содержит активный комплекс натуральных протеинов, минералов, ферменты меди, железа, магния, ацетил метионин, кальций и витамины E, C и F.

Интенсивное восстановление тонких и поврежденных ногтей после наращивания и гель-лака;
Утолщает и восстанавливает ногтевую пластину;
Возвращает ногтям прочность и эластичность;
Содержит аргинин, гидролизованный кератин, масло чайного дерева, лецитин и витамин Е;
Не содержит формальдегида.

Обеспечивает оптимальный баланс увлажнения и питания сухих и ломких ногтей;
Предотвращает ломкость, расслоение и появление трещин;
Выравнивает, уплотняет и укрепляет ногтевую пластину;
Придает ногтям однородный цвет и естественный здоровый вид;
Содержит коллаген и гиалуроновую кислоту.

Мультифункциональное средство для интенсивного восстановления ослабленных ногтей;
Защищает истонченные ногти от ломкости, расслоения и обезвоживания;
Питает и увлажняет;
Содержит комплекс активных компонентов по уходу за ногтями: масло семян подсолнечника, витамины С, Е, F, кальций, растительные протеины, экстракт бурых водорослей, ацетил метионин;
Может использоваться как база под лак.

